import React from 'react'
import { useParams } from 'react-router-dom';


const FilterFeature = () => {
    const {id}=useParams();
    console.log("type",id)
    return (
        <div>
        Filtered
        <h4 variant="h1" color="initial">{id}</h4>
        </div>
    )
}

export default FilterFeature
